column8:
●ペダルを踏むだけでフタが開き、離すとフタが閉まるので、生ゴミのニオイも抑えます。<br><br>●幅をとらないスリムサイズ。<br><br>●ペダルはワイドで踏みやすく、全体から出っ張らない親切設計です。<br><br>●ポリ袋は大容量～レジ袋2枚をセットして分別できます。<br><br>●移動がラクなキャスター付き。<br><br>●袋の取り付けが簡単な袋止め付き。<br><br>●フタが90度以上開くので、ポリ袋のセットも簡単♪<br><br>●ポリ袋は20L（50×60cm）、または取っ手付きポリ袋Lサイズ（30×55cm）以上×2枚に対応しています。　<br><br><table width="500" border="0" align="left" cellpadding="3" cellspacing="1" bgcolor="#CCCCCC" style="font-size:13px; color:#333333;"><tr bgcolor="#FFFFFF"><td width="58">サイズ</td><td>約 幅21×奥行33×高さ47（cm）　</td></tr><tr bgcolor="#FFFFFF"><td width="58">材質</td><td>本体・フタ・袋止め・キャスター/ポリプロピレン<br>ペダル・ロッド/ABS樹脂<br>キャスター外周・取っ手/オレフィン系エラストマー、スチレン系エラストマー、ポリエチレン　</td></tr><tr bgcolor="#FFFFFF"><td width="58">容量</td><td>容量/20L　</td></tr><tr bgcolor="#FFFFFF"><td width="58">重量</td><td>約1.6kg　</td></tr><tr bgcolor="#FFFFFF"><td width="58">カラー</td><td>レッド</td></tr><tr bgcolor="#FFFFFF"><td width="58">生産国</td><td>日本</td></tr></td></tr></table><style type="text/css">
<!--
